import React, { Component } from "react";
import "./App.css";
import CssBaseline from "@material-ui/core/CssBaseline";
import Button from "@material-ui/core/Button";
import CheckBox from "@material-ui/core/Checkbox";
import SearchIcon from "@material-ui/icons/Search";

class PantoneGallery extends Component {
  render() {
    console.log("Gallery props", this.props);
    const { pantones } = this.props;
    return (
      <div>
        {pantones.map((pantone, k) => {
          return (
            <div key={k} className="pantone-item">
              <div
                className="pantone-color"
                style={{ backgroundColor: pantone.Hex }}
              >
                &nbsp;
              </div>
              <div className="pantone-title">{pantone.Code}</div>
              <div className="pantone-title">
                <Button>We like this one</Button>
              </div>
            </div>
          );
        })}
      </div>
    );
  }
}

export default PantoneGallery;
